import React, { use, useEffect, useState } from "react";
import logo from "../../assets/images/logo.png";
import heart from "../../assets/images/heart.png";
import cartImg from "../../assets/images/cart.png";
import { Link } from "react-router-dom";
import { useCart, useNav } from "../../context";
import "./Header.css";
import Navigation from "../Navigation";
import { menu } from "../../assets";
import { useMediaQuery } from "@react-hook/media-query";
import SearchBar from "../SearchBar";
function Header() {
  const { openCart, cartQuantity } = useCart();
  const { isNavOpen, openNav } = useNav();
  const [hideMenu, setHideMenu] = useState(false);
  const [openMenu, setOpenMenu] = useState(false);

  const isDesktop = useMediaQuery("screen and (min-width: 720px)");
  // useEffect(() => {
  //   if (isDesktop) {
  //     closeNav();
  //   }
  // }, [isDesktop, closeNav]);

  const onNavClose = () => {
    const menuBtn = document.getElementById("menu-btn");
    menuBtn?.focus();
  };
  useEffect(() => {
    const handleScroll = () => {
      const header = document.querySelector("header");
      const headerHeight = header
        ? header.getBoundingClientRect().height + 100
        : 80;
      setOpenMenu(window.scrollY > headerHeight);
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <header>
      <div className="header-container">
        <div className="header-left">
          <Link
            tabIndex={openMenu ? -1 : undefined}
            aria-hidden={openMenu}
            to={"/"}
          >
            {" "}
            <img className="logo" src={logo} alt="logo" />
          </Link>
          <div style={{ display: "flex" }}>
            <button
              tabIndex={openMenu ? -1 : undefined}
              aria-hidden={openMenu}
              id="sign-up"
            >
              Sign Up
            </button>
            <button
              tabIndex={openMenu ? -1 : undefined}
              aria-hidden={openMenu}
              id="log-in"
            >
              Log In
            </button>
          </div>
        </div>

        <div className="header-right">
          <button
            tabIndex={openMenu ? -1 : undefined}
            aria-hidden={openMenu}
            aria-controls="nav"
            id={!openMenu ? "menu-btn" : undefined}
            aria-expanded={!isDesktop ? isNavOpen : undefined}
            className="menu-btn"
            onClick={openNav}
          >
            <img className="icon" src={menu} alt="menu" />
          </button>

          <SearchBar
            tabIndex={openMenu ? -1 : undefined}
            aria-hidden={openMenu}
          />
          <Link
            tabIndex={openMenu ? -1 : undefined}
            aria-hidden={openMenu}
            to={"/favorites"}
          >
            <img className="heart" src={heart} alt="heart" />
          </Link>
          <div>
            <button
              tabIndex={openMenu ? -1 : undefined}
              aria-hidden={openMenu}
              onClick={openCart}
            >
              <img className="cart" src={cartImg} alt="cart" />
            </button>
            {cartQuantity > 0 && (
              <button
                tabIndex={openMenu ? -1 : undefined}
                aria-hidden={openMenu}
                className="cart-badge"
                onClick={openCart}
              >
                {cartQuantity}
              </button>
            )}
          </div>
        </div>
      </div>
      <Navigation disabled={openMenu && !isNavOpen} onClose={onNavClose} />

      <div
        className={`sticky-header ${openMenu ? "open" : "closed"} ${
          //if both the nav and sticky menu are open, the hide the sticky menu otherwise make it visible
          //this is to prevent the sticky menu from being visible when the nav is open
          isNavOpen && openMenu ? "" : ""
        }`}
      >
        <button
          aria-controls="nav"
          aria-expanded={!isDesktop ? isNavOpen : undefined}
          className="menu-btn"
          id={openMenu ? "menu-btn" : undefined}
          onClick={openNav}
        >
          <img className="icon" src={menu} alt="menu" />
        </button>
      </div>
    </header>
  );
}

export default Header;
